# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - Django.Forms.Field~Subclass
    - form_utils
    - Member[admin].Member[ClearableFileField]
  - - Django.Forms.Field~Subclass
    - form_utils
    - Member[fields].Member[ClearableFileField]
  - - Django.Forms.Field~Subclass
    - form_utils
    - Member[fields].Member[ClearableImageField]
  - - django.forms.BaseForm~Subclass
    - form_utils
    - Member[forms].Member[BetterForm]
  - - django.forms.BaseForm~Subclass
    - form_utils
    - Member[forms].Member[BetterModelForm]
  - - django.forms.BaseForm~Subclass
    - form_utils
    - Member[forms].Member[PreviewForm]
  - - django.forms.BaseForm~Subclass
    - form_utils
    - Member[forms].Member[PreviewModelForm]
  - - django.forms.BaseForm~Subclass
    - form_utils
    - Member[templatetags].Member[form_utils].Member[BetterForm]
  - - django.forms.BaseForm~Subclass
    - form_utils
    - Member[templatetags].Member[form_utils].Member[BetterModelForm]
